import {React,  useEffect, useState } from "react";
import { useLocation, useParams,useNavigate, Navigate, createSearchParams } from "react-router-dom";
import axios from 'axios';
import Header from "../layouts/Header";



function PatientForm()
{
  const location = useLocation();
  const dentistId = new URLSearchParams(location.search).get('dentistId');
  
  const navigate = useNavigate();
  

  const [patient, setPatient] = useState({
      name: "",
      surname: "",
      ssn: "",
      birthdate: "",
      gender: "",
      email: "",
      telephone: "",
      address: "",
      dentist_id: 0
    });

    console.log('passedId', dentistId);

    function handleChange(event)
    {
        const { name, value } = event.target;

        setPatient(prevValue => {
            return {
              ...prevValue,
              [name]: value
            };
          });
    }
    
    const handleLogin = async(event) =>
    {
      
      event.preventDefault();
      console.log("line 37 Login")
      try{
        
        const response = await axios.post(`http://localhost:8080/patients/addPatient?dentistId=${dentistId}`,
        
        JSON.stringify(patient),
          {
            headers: {"Content-Type": "application/json"},
            withCredentials:false
          }
        );
        const queryParams = {submittedName:patient.name, submittedSurname:patient.surname, result: ""};
        if(response.status===201)
        {
          queryParams.result = "true";
          console.log("Succesful submit");
          
          
        }else{
          queryParams.result = "fail";
          console.log("Unsuccesful submit");
        }
        navigate({pathname: `/dentistpage/${dentistId}/patientForm/resultForm`, search: `?${createSearchParams(queryParams)}`});
      }catch(err){
        console.log(err);
        
      };
      
      
    }



   
    return (
      <div>
        <Header title={"ToothHub"}/>
        <div style={{width:"30%", height:"100%", marginTop:"2%"}}>
          <h2 style={{textAlign:"left", paddingLeft:"10px", color:"white"}}>New Patient Form</h2>

          <form onSubmit={handleLogin}>

            <label for="fname" style={{color:"white"}}>First name:</label><br/>
            <input type="text"  name="name" onChange= {handleChange} value={patient.name} style={{float:"left", paddingLeft:"15px"}}/>
            <br/>   
            <br/>
            <br/>
            <label for="lname" style={{color:"white"}}>Last name:</label><br/>
            <input type="text"  name="surname" onChange= {handleChange} value={patient.surname} style={{float:"left", paddingLeft:"15px"}}/>
            <br/>   
            <br/>
            <br/>
            <label for="ssn" style={{color:"white"}}>Social Security Number (SSN):</label><br/>
            <input type="text"  name="ssn" onChange= {handleChange} value={patient.ssn} style={{float:"left", paddingLeft:"15px"}}/>
            <br/>   
            <br/>
            <br/>
            <label for="birthdate" style={{color:"white"}}>Date:</label><br/>
            <input type="date"  name="birthdate" onChange= {handleChange} value={patient.birthdate} style={{float:"left", paddingLeft:"15px"}}/>
            <br/>   
            <br/>
            <br/>
            <label for="gender" style={{color:"white", padding: "5px 5px"}}>Choose gender: </label> 
                <select name="gender" id="gender" onChange= {handleChange} style={{ borderRadius: "25px", margin:"10px 10px"}}> 
                    <option name= "gender" value={"Male"} >Male</option> 
                    <option name="gender" value={"Female"} >Female</option> 
                    
                </select>
            <br/>   
            <br/>
            <br/>
            <label for="email" style={{color:"white"}}>Email:</label><br/>
            <input type="text"  name="email" onChange= {handleChange} value={patient.email} style={{float:"left", paddingLeft:"15px"}}/>
            <br/>   
            <br/>
            <br/>

            <label for="telephone" style={{color:"white"}}>Telephone:</label><br/>
            <input type="text"  name="telephone" onChange= {handleChange} value={patient.telephone} style={{float:"left", paddingLeft:"15px"}}/>
            <br/>   
            <br/>
            <br/>

            <label for="address" style={{color:"white"}}>Address:</label><br/>
            <input type="text"  name="address" onChange= {handleChange} value={patient.address} style={{float:"left", paddingLeft:"15px"}}/>
            <br/>   
            <br/>
            <br/>
            


            <button >Save</button>

          </form>

      </div>
    </div>);




}

export default PatientForm;
